Welcome to Kaver! 

The ultimate spot for finding niche spaces in New York. Discover cool places to eat, hang out with friends or see your favorite bands live.

Navigator to the world's top and unique online events is also available.

Be the first to learn about unique places and events that you cannot find on your own

Kaver is:

- events from all over the world;

- events not from any other guide;

- map with unique and hidden places;

- exhibitions of modern art (online and in person)

- online performances from theaters (across/ all over) the world;

- underground music shows;

- the craziest live broadcasts!


Kaver is not only about well known theaters, shows and exhibitions, it's a place to discover unique experiences. Our list of events and broadcasts cannot be found in other apps!


Find:

With the help of search and filters, you will quickly find exactly what you want to see and visit.

And if you don't want to search, just press the button and watch random broadcasts.

Or check the events from the selections on every occasion.


Kaver is your way to:

Become an expert in the world of events an surprise your friends!

Find unconventional performances, the most daring and modern exhibitions, poetry nights, indie music shows, private parties, groovy festivals and of course the coolest, most unexpected amazing places in the city. Take your pick and go!


Staying in can be different! We offer you an alternative to Netflix and chill: theater performances from all over the world, shows of your favorite or indie bands no one heard off yet, free masterclasses, exhibitions of modern or classical art, parties, DJ sets and much more! Everything is at your hand!

Arrange online home parties, concerts, walks around the cities of the world! Your possibilities are endless.


What you can do in the Kaver app:

- navigate through the top-notch and exceptional events;

- watch broadcasts directly in the app;

- customize filters to match your taste;

- find out about the ticket prices and availability;



- never miss events of interest! Mark them and the app will remind you!


Install Kaver, be trendy!
